import { Review } from '../svg'

const testimonial = [
    {
        id:1,
        user:require('../assets/images/review/user-1.png'),
        rating:<Review/>,
        name:'Kathryn Murphy',
        desc:"In this course I'll show the step by step, day by day process to build better products.In this course I'll show the step by step"
    },
    {
        id:2,
        user:require('../assets/images/review/user-2.png'),
        rating:<Review/>,
        name:'Dianne Russell',
        desc:"Amet minim mollit non deserunt ullamco est sit aliqua dolor do amet sint. Velit officia consequat duis enim velit mollit. Exercitation"
    },
    {
        id:3,
        user:require('../assets/images/review/user-3.png'),
        rating:<Review/>,
        name:'Theresa Webb',
        desc:"In this course I'll show the step by step, day by day process to build better products.In this course I'll show the step by step"
    },
    {
        id:4,
        user:require('../assets/images/review/user-1.png'),
        rating:<Review/>,
        name:'Devon Lane',
        desc:"Amet minim mollit non deserunt ullamco est sit aliqua dolor do amet sint. Velit officia consequat duis enim velit mollit. Exercitation veniam consequat sunt nostrud amet."
    },
    {
        id:5,
        user:require('../assets/images/review/user-2.png'),
        rating:<Review/>,
        name:'Leslie Alexander',
        desc:"In this course I'll show the step by step, day by day process to build better products.In this course I'll show the step by step"
    },
]

export default testimonial;
